import './App.scss';
import {Routes, Route} from 'react-router-dom'

const App = () => {
  return (
    <div>
      <header className="App-header">
        Gym Buddy
      </header>
      <Routes>
        <Route path='/' element={<LandingPage />}/>
      </Routes>
    </div>
  );
}

export default App;
